// import List from '@material-ui/core/List'
// import ListItem from '@material-ui/core/ListItem'
// import ListItemText from '@material-ui/core/ListItemText'
import React, { Component } from 'react'

class SidebarComponent extends Component {
    constructor(props) {
        super(props)
        this.state = {
        }
    }

    render() {
        return (
            <div className="col">
                <div className="row"
                onClick={() => this.props.viewClicked(0)}>
                    Overview
                </div>
                <div className="row"
                onClick={() => this.props.viewClicked(1)}>
                    Labor
                </div>
                <div className="row"
                onClick={() => this.props.viewClicked(2)}>
                    Summary
                </div>
                <div className="row"
                onClick={() => this.props.viewClicked(3)}>
                    Units
                </div>
            </div>
        )
    }
}

export default SidebarComponent
